function PlanetDetail(props) {
  return (
    <div className="planet-details">
      <h3>Planet Detail</h3>
      <p>Planet {props.name}</p>
      <p>Color: {props.color}</p>
      <p> Number of Moons : {props.num_moons}</p>
    </div>
  );
}

export default PlanetDetail;
